  const [open, setOpen] = useState(false);
    console.log(open);
  return (
    <Modal
      onClose={() => setOpen(false)}
      onOpen={() => setOpen(true)}
      open={open}
      trigger={
        <Button basic color="green">
          Show Modal
        </Button>
      }
    >

    </Modal>
  );
}

export default ModalExampleModal;
